import React from "react";
import Header from "./Header";
import Footer from "./Footer";
import Records from "./Records";
import Menu from "./Menu";
import Tabs from "./Tabs"
import World from "./WorldRecord"

function App() {
    return (
        <div>
            <Menu />
            <Header />
            {/* {<div className="container">} */}
            <Tabs />
            <World />
            {/* {</div>} */}
            {/* <Footer /> */}
        </div>
    );
}

export default App;
